import './App.scss';
import Logo from './images/Logo';

export class Slide1 extends Component {
  render(){
  return <div className="slide1">
  <h1>COMPARE YOURSELF</h1>
  <h1>TO THE BIGGEST</h1>
  <img>{Logo}</img>
  <span>STARS</span></div>
  }
}

export default Slide1;
